import React from "react";
import styled from "styled-components";
import "../styles/post.css";

const Custompost = styled.header`

  font-family: "Open Sans Condensed", sans-serif;
  letter-spacing: 0.5px;
`;



function Post() {
 return(
     <pCustompost>
    <div className="post">
       <p className="posts-title">Top Announcements</p>
     </div>
     </pCustompost>
 )
}

export default Post;
